import React,{Component} from 'react';
import './App.css';
//import web3 from './web3';

class App extends Component {
  render(){
    return(
      <div className="shopping-list">
      <h1>Shopping List for {this.props.name}</h1>
      <ul>
        <li>Instagram</li>
        <li>WhatsApp</li>
        <li>Oculus</li>
      </ul>
    </div>

    );
  }

}


export default App;
